import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  const [data, setData] = useState(null)

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      setData(res.json())
    })

  });

  return (
  <div>
    Welcome to Next.js!
    <div>
      {data}
    </div>
  </div>
  )
}

export default HomePage
